import React, { useEffect } from 'react';
import Section from './Section';
import Text from './Text';
import LineBreak from './LineBreak';
import ResumePDF from '../assets/documents/Resume.pdf';
import ResumePic from '../assets/images/resume.png';

function Resume() {
  useEffect(() => {
    // Automatically open the resume PDF when the component is rendered
    window.open(ResumePDF, '_blank', 'noopener,noreferrer');
  }, []);

  return (
    <div>
      <Section>
        <h1 className="text-5xl mb-3">
          Resume
        </h1>
        <LineBreak />
      </Section>

      <Section>
        <Text>
          Click the link below to download my resume.
        </Text>
      </Section>

      <Section>
        <a href={ResumePDF} target="_blank" rel="noreferrer" className="text-link font-normal">
          Download Resume
        </a>
      </Section>
      <img src={ResumePic} alt="Resume" className="resume-image" />
    </div>
  );
}

export default Resume;
